def sieve(max_n):
    if max_n < 2:
        return [False] * (max_n + 1)
    sieve = [True] * (max_n + 1)
    sieve[0] = sieve[1] = False
    for i in range(2, int(max_n**0.5) + 1):
        if sieve[i]:
            sieve[i*i : max_n+1 : i] = [False] * len(sieve[i*i : max_n+1 : i])
    return sieve

