def count_beautiful_numbers(n, k):
    if n < 0:
        return 0

    s = str(n)
    l = len(s)

    from functools import lru_cache

    @lru_cache(maxsize=None)
    def dp(pos, diff, mod_k, tight, is_prefix):
        if pos == l:
            return 1 if diff == 0 else 0

        res = 0
        max_digit = int(s[pos]) if tight else 9

        if pos == 0:
            # Skip leading zeros
            for d in range(1, max_digit + 1):
                new_tight = tight and (d == max_digit)
                new_diff = diff + (1 if d % 2 == 0 else -1)
                new_mod_k = (mod_k * 10 + d) % k
                res += dp(pos + 1, new_diff, new_mod_k, new_tight, is_prefix)
        else:
            for d in range(0, max_digit + 1):
                new_tight = tight and (d == max_digit)
                new_diff = diff + (1 if d % 2 == 0 else -1)
                new_mod_k = (mod_k * 10 + d) % k
                res += dp(pos + 1, new_diff, new_mod_k, new_tight, is_prefix)

        return res

    return dp(0, 0, 0, True, True)

