def count_valid_strings(n):
    if n < 2:
        return 0  # Not enough characters to have at least two of either
    total = 26 ** n
    A = 25 ** n + n * (25 ** (n - 1))
    B = 25 ** n + n * (25 ** (n - 1))
    C = 0

    # Compute C
    for e in [0, 1]:
        for l in [0, 1]:
            if e + l > n:
                continue
            if e == 0 and l == 0:
                C += 24 ** n
            elif e == 0 and l == 1:
                C += n * (24 ** (n - 1))
            elif e == 0 and l == 2:
                C += math.comb(n, 2) * (24 ** (n - 2))
            elif e == 1 and l == 0:
                C += n * (24 ** (n - 1))
            elif e == 1 and l == 1:
                C += n * (n - 1) * (24 ** (n - 2))
            elif e == 1 and l == 2:
                if n >= 3:
                    C += n * math.comb(n - 1, 2) * (24 ** (n - 3))
    return total - A - B + C

